While inheritance is a powerful feature when used correctly, it also has the drawback that it tends to complicate class dependencies, especially when multiple or multi-layer inheritance is used. Complicated dependencies can reduce code maintainability. The reason Erg prohibits multiple and multi-layer inheritance is to reduce this risk, and the class patch feature was introduced to reduce the complexity of dependencies while retaining the "add functionality" aspect of inheritance. So, conversely, where should inheritance be used? One indicator is when "semantic subtypes of the base class are desired. Erg allows the type system to automatically do part of the subtype determination (e.g., Nat, where Int is greater than or equal to 0). However, for example, it is difficult to create a "string type representing a valid e-mail address" relying solely on Erg's type system. You should probably perform validation on a normal string. Then, we would like to add some kind of "warrant" to the string object that has passed validation. That is the equivalent of downcasting to an inherited class. Downcasting a Str object to ValidMailAddressStr is a one-to-one correspondence with validating that the string is in the correct email address format. ValidMailAddressStr = Inherit Str
ValidMailAddressStr. init s: Str = validate s # mail-address validation Self.new s s1 = "invalid mail address"
s2 = "foo@gmail.com"
_ = ValidMailAddressStr.init s1 # panic: invalid mail address
valid = ValidMailAddressStr.init s2
valid: ValidMailAddressStr # assurance that it is in the correct email address format Another indicator is when you want to achieve a nominal polymorphism. For example, the greet! procedure defined below will accept any object of type Named. But obviously it is wrong to apply a Dog type object. So we will use the Person class for the argument type. This way, only Person objects, classes that inherit from them, and Student objects will be accepted as arguments. This is more conservative and avoids unnecessarily assuming too much responsibility. Named = {name = Str; ...}
Dog = Class {name = Str; breed = Str}
Person = Class {name = Str}
Student = Inherit Person, additional: {id = Int}
structural_greet! person: Named = print! "Hello, my name is {person::name}."
greet! person: Person = print! "Hello, my name is {person::name}." max = Dog.new {name = "Max", breed = "Labrador"}
john = Person.new {name = "John"}
alice = Student.new {name = "Alice", id = 123} structural_greet! max # Hello, my name is Max.
structural_greet! john # Hello, my name is John.
greet! alice # Hello, my name is Alice.
greet! max # TypeError: Previous | Next
